class ImageFromSvg {

  static Future<Uint8List> _ConvertImageFromAsset(String ImagePath) async {
    final ByteData bytes = await rootBundle.load(ImagePath);
    final Uint8List list = bytes.buffer.asUint8List();
    return list;
  }

  static Uint8List _convertBase64Tobytes(String imagePath){
     return base64Decode(imagePath);
  }

  static Uint8List Facebook() {
    var data = _convertBase64Tobytes(ImagesPath.FaceBook);
    return data;
  }

  static Uint8List Google() {
    var data = _convertBase64Tobytes(ImagesPath.Google);
    return data;
  }

  static Uint8List Apple() {
    var data = _convertBase64Tobytes(ImagesPath.Apple);
    return data;
  }
}

